(1, 'Casa a pochi metri dall\'Università dell\'Aquila (Coppito)', 2, 250, '2024-09-01', 'Villetta spaziosa a pochi metri dal polo di Coppito dell\'Università degli Studi dell\'Aquila. Dotata di stanze spaziose, luoghi comuni accoglienti e balcone per godersi il tepore della sera. Le utenze sono incluse nel prezzo mensile.', 3, 125, 30, 0, 0, 0, 0, 1, 1),
(2, 'Casa a pochi metri dall\'Università di Ancona', 3, 800, '2024-09-01', 'Casa vicino all\'Università Politecnica delle Marche. Terzo piano, senza ascensore, ma appartamento molto spazioso. Non vi è possibilità di parcheggiare una macchina, poiché l\'abitazione si trova in una zona pedonale. Le utenze sono escluse dall\'affitto mensile.', 2, 250, 30, 0, 1, 0, 0, 1, 1),
(3, 'Appartamento a Bologna', 4, 400, '2024-09-01', 'Nel cuore più antico della splendida Bologna, incastonata in un\'antico palazzo nobiliare originario del 1500, troviamo una residenza di grande fascino interamente affrescata da Felice Giani, illustre pittore del primo neoclassico italiano che oltre ai tanti e noti palazzi nobiliari della penisola, ha firmato opere di grande valore anche a San Pietroburgo ed a Parigi tra la fine del 1700 e la prima decade dell\'800. Le utenze non sono incluse.', 2, 200, 30, 1, 0, 1, 1, 1, 2);

